}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32">  <g>    <polygon points="11 11 5 11 5 14 14 14 14 5 11 5 11 11" fill="#fff"/>    <polygon points="21 11 21 5 18 5 18 14 27 14 27 11 21 11" fill="#fff"/>    <polygon points="18 27 21 27 21 21 27 21 27 18 18 18 18 27" fill="#fff"/>    <polygon points="5 21 11 21 11 27 14 27 14 18 5 18 5 21" class="aw-theme-iconOutline" fill="#fff"/>  </g></svg>';
        export const SvgComponent = React.memo(SvgComp);
